import { makeStyles } from '@mui/styles';


export const useStyles = makeStyles({
 
  menuPart:{
    display:"flex",
    justifyContent:"space-between",
    marginLeft:"150px"
  },
 
  mainCart:{
    backgroundColor: "gray", height: "100px", width: "100%" 
  },
 
  pText:{
    fontSize:"12px",
    color:"gray",
    textAlign:"left"
  },
  HeadText:{
    color:"gray",
    textAlign:"left",
    fontWeight:"600",
    margin:"0px"
  }


});
